const { LinkedList } = require("../helpers");

setTimeout(() => console.log(calc2(getInput())));

function calc1(input) {
  const units = input.trim().split("");

  const list = new LinkedList(units);

  for (let item = list.first; item && item.next; ) {
    const next = item.next;
    if (match(item.value, next.value)) {
      const toCheck = item.prev || next.next;

      item.remove();
      next.remove();

      item = toCheck;
    } else {
      item = item.next;
    }
  }

  const res = list.toArray().join("");
  return res.length;
}

function calc2(input) {
  const units = input.trim();
  let minLen = Infinity;
  for (letter of "abcdefghijklmnopqrstuvwxyz") {
    const filteredUnits = units.replace(new RegExp(letter, "ig"), "");
    const len = calc1(filteredUnits);
    if (len < minLen) {
      minLen = len;
    }
  }

  return minLen;
}

const matchDict = "abcdefghijklmnopqrstuvwxyz".split("").reduce((obj, a) => {
  obj[a] = a.toUpperCase();
  obj[a.toUpperCase()] = a;
  return obj;
}, {});
function match(a, b) {
  return matchDict[a] === b;
}

